#[test]
fn bindgen_test_layout_PhidgetGPS_Time() {
    assert_eq!(
        ::std::mem::size_of::<PhidgetGPS_Time>(),
        8usize,
        concat!("Size of: ", stringify!(PhidgetGPS_Time))
    );
    assert_eq!(
        ::std::mem::align_of::<PhidgetGPS_Time>(),
        2usize,
        concat!("Alignment of ", stringify!(PhidgetGPS_Time))
    );
    assert_eq!(
        unsafe { &(*(::std::ptr::null::<PhidgetGPS_Time>())).tm_ms as *const _ as usize },
        0usize,
        concat!(
            "Offset of field: ",
            stringify!(PhidgetGPS_Time),
            "::",
            stringify!(tm_ms)
        )
    );
    assert_eq!(
        unsafe { &(*(::std::ptr::null::<PhidgetGPS_Time>())).tm_sec as *const _ as usize },
        2usize,
        concat!(
            "Offset of field: ",
            stringify!(PhidgetGPS_Time),
            "::",
            stringify!(tm_sec)
        )
    );
    assert_eq!(
        unsafe { &(*(::std::ptr::null::<PhidgetGPS_Time>())).tm_min as *const _ as usize },
        4usize,
        concat!(
            "Offset of field: ",
            stringify!(PhidgetGPS_Time),
            "::",
            stringify!(tm_min)
        )
    );
    assert_eq!(
        unsafe { &(*(::std::ptr::null::<PhidgetGPS_Time>())).tm_hour as *const _ as usize },
        6usize,
        concat!(
            "Offset of field: ",
            stringify!(PhidgetGPS_Time),
            "::",
            stringify!(tm_hour)
        )
    );
}
